import React from 'react';
import styles from"./Profile.module.css";
import { Col, Row } from 'react-bootstrap';


const Profile = () =>{
    return(
        <Col xs='7' className='content'>
            <Row>
                <Col xs='12'>
                    <img src='london.jpg'></img>
                </Col>
                <Col xs='col-12'>ava+description</Col>
                <Col xs='col-12'>my/new posts</Col>
                <Col xs='col-12'>post 1.2...</Col>
            </Row>
        </Col>
    )
}
export default Profile;
